package com.sfmd.algorithm.leetCode.string.solution680;

public class Solution {

    public static void main(String[] args) {

        System.out.println("aba-"+validPalindrome("aguokepatg" +
                "bnvfqmgmlc" +
                "upuufxoohdfpgjdmysgvhmvffcnqxjjxqncffvmhvgsymdjgpfdhooxfuupuc" +
                "ulmgmqfvnb" +
                "gtapekouga"));
        System.out.println("daba-" + validPalindrome(""));
        System.out.println("adba-"+validPalindrome("adba"));
        System.out.println("adcc-"+validPalindrome("abcc"));
        System.out.println("ccab-"+validPalindrome("ccab"));

        System.out.println("abda-"+validPalindrome("abda"));
        System.out.println("abad-"+validPalindrome("abad"));
        System.out.println("abba-"+validPalindrome("abba"));
        System.out.println("dabba-"+validPalindrome("dabba"));
        System.out.println("adbba-"+validPalindrome("adbba"));
        System.out.println("abdba-"+validPalindrome("abdba"));
        System.out.println("abbda-"+validPalindrome("abbda"));
        System.out.println("abbad-"+validPalindrome("abbad"));

    }

    /**
     * 检测该字符串是否是回文字符串(删除0/1个字符串)
     * @param s : 检测的字符串
     */
    public static boolean validPalindrome(String s) {
        char[] array = s.toCharArray();
        int end = array.length - 1;
        int begin = 0;

        while (begin <= end) {
            if (array[begin] == array[end]) {
                begin++;
                end--;
                continue;
            }
            return validPalindrome(array,begin +1, end)
                    || validPalindrome(array, begin, end-1);
        }
        return true;
    }

    /**
     * 检测是否是回文字符串(从begin~end)
     * @param array 字符数组
     * @param begin 开始位置
     * @param end 结束位置
     * @return 字符串给定区间是否是回文字符串
     */
    private static boolean validPalindrome(char[] array, int begin,int end) {
        while (begin <= end) {
            if (array[begin] == array[end]) {
                begin++;
                end--;
                continue;
            }
           return false;
        }
        return true;
    }

}
